import Navbar from './Components/Navbar';
import React, { useState } from 'react';
import News from './Components/News';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LoadingBar from 'react-top-loading-bar';

const App = (props) => {
  const pageSize = 5;
  const apikey = process.env.REACT_APP_NEWS_API;

  const [progress, setProgress] = useState(0);

  return (
    <Router>
      <Navbar />

      <LoadingBar color='#f1194 pageSize' progress={progress} height={5} />

      <Routes>
        <Route
          exact
          path='/'
          element={
            <News
              apikey={apikey}
              setProgress={setProgress}
              key={'general'}
              pageSize={pageSize}
              country='in'
              category='general'
            />
          }
        />
        <Route
          exact
          path='/business'
          element={
            <News
              apikey={apikey}
              setProgress={setProgress}
              key={'business'}
              pageSize={pageSize}
              country='in'
              category='business'
            />
          }
        />
        <Route
          exact
          path='/entertainment'
          element={
            <News
              apikey={apikey}
              setProgress={setProgress}
              key={'entertainment'}
              pageSize={pageSize}
              country='in'
              category='entertainment'
            />
          }
        />
        <Route
          exact
          path='/health'
          element={
            <News
              apikey={apikey}
              setProgress={setProgress}
              key={'health'}
              pageSize={pageSize}
              country='in'
              category='health'
            />
          }
        />
        <Route
          exact
          path='/science'
          element={
            <News
              apikey={apikey}
              setProgress={setProgress}
              key={'science'}
              pageSize={pageSize}
              country='in'
              category='science'
            />
          }
        />
        <Route
          exact
          path='/sports'
          element={
            <News
              apikey={apikey}
              setProgress={setProgress}
              key={'sports'}
              pageSize={pageSize}
              country='in'
              category='sports'
            />
          }
        />
        <Route
          exact
          path='/technology'
          element={
            <News
              apikey={apikey}
              setProgress={setProgress}
              key={'technology'}
              pageSize={pageSize}
              country='in'
              category='technology'
            />
          }
        />
      </Routes>
    </Router>
  );
};

export default App;
